
--
-- Table structure for table `tkwp_project`
--

CREATE TABLE IF NOT EXISTS `tkwp_project` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `pro_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `pro_description` text CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `pro_color` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `pro_start_date` date NOT NULL,
  `pro_start_time` time NOT NULL,
  `pro_finish_date` date NOT NULL,
  `pro_finish_time` time NOT NULL,
  `pro_status` tinyint(4) NOT NULL,
  `pro_type` tinyint(4) NOT NULL,
  `pro_domain` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `pro_customer` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `pro_member` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `pro_manager` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `pro_begin_date` int(11) NOT NULL,
  `user` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB  DEFAULT CHARSET=latin1 AUTO_INCREMENT=190 ;

